const (
	sizeOfLength   = 2
	sizeOfUnknown  = 2
	sizeOfCmd      = 2
	headerSize     = sizeOfLength + sizeOfUnknown + sizeOfCmd
)

// Frame defines a packet for SDGO client
type Frame struct {
	cmd  uint16
	unk  uint16
	data []byte
	rawData []byte
}

func newFrame(cmd uint16) Frame {
	return Frame{cmd: cmd, unk: 0x03F0}
}

func newFrame2() Frame {
	return Frame{unk: 0x03F0}
}

func (f Frame) String() string {
	return fmt.Sprintf("[%04X][%04d][%04X]% 02X", f.cmd, len(f.data), f.unk, f.rawData )
}

type rawHeader []byte

func (h rawHeader) Length() uint16 {
	return binary.LittleEndian.Uint16(h[0:])
}

func (h rawHeader) Unknown() uint16 {
	return binary.LittleEndian.Uint16(h[2:])
}

func (h rawHeader) Cmd() uint16 {
	return binary.LittleEndian.Uint16(h[4:])
}

func (h rawHeader) String() string {
	return fmt.Sprintf("[%04X][%04d][%04d]", h.Cmd(), h.Length(), h.Unknown() )
}

func readFrame(conn io.ReadCloser, buffer []byte) (f Frame, err error) {
	if _, err := io.ReadFull(conn, buffer[:headerSize]); err != nil {
		return f, errors.New("readFrame: " + err.Error())
	}

	dec := rawHeader(buffer)
	f.cmd = dec.Cmd()
	f.unk = dec.Unknown()
	length := dec.Length() - sizeOfCmd
	if length > 0 {
		if _, err := io.ReadFull(conn, buffer[headerSize:headerSize+length]); err != nil {
			return f, errors.New("readFrame: " + err.Error())
		}
	}
	f.data = buffer[headerSize - sizeOfCmd : headerSize+length]
	f.rawData = buffer[0 : headerSize+length]

	return f, nil
}


func writeRawFrame(conn io.WriteCloser, dataHex string) (n int, err error) {
	nospace := SpaceStringsBuilder(dataHex)
	data, err := hex.DecodeString(nospace)
	if err != nil {
		return
	}
	return conn.Write(data)
}

func writeFrame(conn io.WriteCloser, data []byte) (n int, err error) {
	size := len(data)
	buf := make([]byte, 4, 4+size)
	binary.LittleEndian.PutUint16(buf[0:2], uint16(size))
	buf[2] = 0xF0
	buf[3] = 0x03

	_, err = conn.Write(buf)
	if err != nil {
		return
	}
	return conn.Write(data)
}

func Raw2Byte(dataHex string) ([]byte) {
	nospace := SpaceStringsBuilder(dataHex)
	data, err := hex.DecodeString(nospace)
	if err != nil {
		return nil
	}
	return data
}

func SpaceStringsBuilder(str string) string {
	var b strings.Builder
	b.Grow(len(str))
	for _, ch := range str {
		if ch != ' ' && ch != '\n' {
			b.WriteRune(ch)
		}
	}
	return b.String()
}

